import React, { Component } from 'react'
import ListItem from './ListItem'

class List extends Component {
    constructor(props) {
        super(props)

    }


    render() {
        const cars = [
            {name: "MG Hector", type: "SUV", img: "http://informus.ru/wp-content/uploads/2020/02/12-400x400.jpg"},
            {name: "Honda City", type: "Sedan", img: "https://winmin.in/wp-content/uploads/2018/12/9_Orchid-White-Pearl-400x400.jpg"},
            {name: "Maruti Baleno", type: "Hatchback", img: "https://winmin.in/wp-content/uploads/2018/12/maruti-baleno-posture-1-400x400.jpg"}
        ]
        const carList = cars.maps(car => <ListItem carObject = {car}/>)
        return  <div> {carList} </div>

    }
}

export default List
